    data: |
      SELECT DISTINCT + + col1 * + - 4 + - col0 AS col0 FROM tab1 (FORMAT parquet) WHERE NOT ( + ( + 68 ) ) * - - col2 - CAST ( + 59 AS INTEGER ) + + 59 IS NOT NULL;
  - name: tab1

outputs:
  - name: q2023.out
    data: |
